Clone_of_Case_CaseRe_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(Static_New_1.selection, 0, "Text2").asString()}}];
q = group q by 'Case_CaseRecordType_Name';
q = foreach q generate 'Case_CaseRecordType_Name' as 'Case_CaseRecordType_Name', unique('Id') as 'unique_Id';
q = order q by 'Case_CaseRecordType_Name' asc;
q = limit q 2000;

Clone_of_Reopened_Re_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q_B = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(Static_New_1.selection, 0, "Text2").asString()}}];
q_C = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(Static_New_1.selection, 0, "Text3").asString()}}];
result = group q by all full, q_B by all full, q_C by all;
result = foreach result generate coalesce(sum(q.'isReopenedCareRequest'),0) as 'A', coalesce(sum(q_B.'isReopenedCareRequest'),0) as 'B', coalesce(sum(q_C.'isReopenedCareRequest'),0) as 'C';
result = foreach result generate 'A', 'B', 'C',  coalesce((B-C)/C,0) as 'D';
result = limit result 2000;

